import React, {useState} from 'react';

const TodoList = ({taskList, inputText}) => {
    const updateList = () => {
        taskList.forEach(task=> {
            return (
                <li>{task}</li>
            )
        })
    }
    return (
        <div className="todo-container">
            <ul className="todo-list">
                {inputText}
                {updateList}
            </ul>
        </div>
    )
}

export default TodoList
